import React from 'react'
import { Navigate } from 'react-router-dom';
const Landing = () => {

    if(localStorage.token)
    {
        return(
            <iframe title='ElevenHealth' src="https://sense-demo.qlik.com/sso/single/?appid=cd840389-f841-4477-86be-532fb0b13775&sheet=aLvPhq&opt=ctxmenu,currsel" allowFullScreen="true" style={{border:0}}></iframe>
        );
    }
    else {
        return <Navigate to="/" />;
    }
}

export default Landing;
